comments.text:
Very good! As an OpenSCAD programmer I have modified my copy - added part 'O', a column to allow the use of B,C,&amp;D with OpenForge Tudor Walls, and cleaned up some of the code.<br />
Added to bottom of basepiece:<br />
for (x = [-unitwidth<em >xmult/2,unitwidth</em>xmult/2]){<br />
translate([x, 0, 0])<br />
rotate([90,0,0])<br />
rotate([0,0,45])<br />
cube([1,1,unitwidth<em >5],center=true);<br />
}<br />
for (y = [-unitwidth</em>ymult/2,unitwidth<em >ymult/2]){<br />
translate([0,y, 0])<br />
rotate([0,90,0])<br />
rotate([0,0,45])<br />
cube([1,1,unitwidth</em>5],center=true);<br />
}<br />
and modified print_part:<br />
module print_part(){<br />
part_size=25;<br />
if (Units == "Imperial") { part_size=25.4; }<br />
if (part == "e") { part_e(part_size);<br />
} else if (part == "a") { part_a(part_size);<br />
} else if (part == "b") { part_b(part_size);<br />
} else if (part == "c") { part_c(part_size);<br />
} else if (part == "d") { part_d(part_size);<br />
} else if (part == "f") { part_f(part_size);<br />
} else if (part == "g") { part_g(part_size);<br />
} else if (part == "o") { part_o(part_size);<br />
} else if (part == "u") { part_u(part_size);<br />
} else if (part == "r") { part_r(part_size);<br />
} else if (part == "s") { part_s(part_size);<br />
} else if (part == "sa") { part_sa(part_size);<br />
} else if (part == "sb") { part_sb(part_size);<br />
} else if (part == "v") { part_v(part_size);<br />
} else { part_e(part_size);<br />
}<br />
}<br />
added module for part o:<br />
module part_o(unitwidth=24.4){<br />
difference(){<br />
union(){<br />
difference(){<br />
basepiece(unitwidth, 2, 2);<br />
translate([unitwidth,unitwidth,0])<br />
rotate([0,0,45]) cube([unitwidth<em >2.828,unitwidth</em>2.818,WallHeight<em >2.1],center=true);<br />
rotate([0,90,-45]) rotate([0,0,45])<br />
cube([1,1,unitwidth</em>3],center=true);<br />
rotate([0,0,45]) clipcut();<br />
for (r = [90,180]){<br />
rotate([0,0,r])<br />
translate([0,unitwidth,0])<br />
rotate([0,0,90])<br />
clipcut();<br />
}<br />
translate([-unitwidth,-unitwidth,0])<br />
rotate(45)<br />
translate([unitwidth*2,0,0])<br />
clipcut();<br />
}
